import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = function() {
  const navigate = useNavigate();

  const handleSignUp = function(e) {
    e.preventDefault();
    // Burada kayıt işlemleri veya yönlendirme yapılabilir
    navigate('/register');
  };

  return React.createElement(
    'div',
    { className: 'landing-container' },
    // Üst menü (navbar)
    React.createElement(
      'header',
      { className: 'landing-header' },
      // Sol tarafta logo/isim
      React.createElement(
        'div',
        { className: 'logo-area' },
        React.createElement('span', null, 'MyFinance')
      ),
      // Sağ tarafta menü linkleri
      React.createElement(
        'nav',
        { className: 'landing-nav' },
        React.createElement(
          'ul',
          null,
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#buy-crypto' }, 'Buy Crypto')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#markets' }, 'Markets')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#trade' }, 'Trade')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#futures' }, 'Futures')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#earn' }, 'Earn')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#login' }, 'Login')
          ),
          React.createElement(
            'li',
            null,
            React.createElement('a', { href: '#signup', className: 'signup-link' }, 'Sign Up')
          )
        )
      )
    ),
    // Ana içerik
    React.createElement(
      'section',
      { className: 'landing-content' },
      // Sol kısım: Büyük başlık ve Sign Up formu
      React.createElement(
        'div',
        { className: 'left-content' },
        React.createElement(
          'h1',
          { className: 'big-title' },
          '264,041,203 USERS TRUST US'
        ),
        React.createElement(
          'p',
          { className: 'sub-text' },
          'Dijital varlıklarınızı güvenli ve hızlı bir şekilde yönetin.'
        ),
        React.createElement(
          'form',
          { className: 'signup-form', onSubmit: handleSignUp },
          React.createElement('input', {
            type: 'email',
            placeholder: 'Email/Phone number',
            className: 'signup-input'
          }),
          React.createElement(
            'button',
            { type: 'submit', className: 'signup-btn' },
            'Sign Up'
          )
        ),
        React.createElement(
          'div',
          { className: 'app-download' },
          React.createElement(
            'p',
            null,
            'Download App'
          ),
          React.createElement(
            'div',
            { className: 'app-icons' },
            React.createElement(
              'a',
              { href: '#appstore', className: 'app-store-link' },
              React.createElement('img', {
                src: 'https://upload.wikimedia.org/wikipedia/commons/a/ab/Apple-logo.png',
                alt: 'App Store',
                className: 'store-icon'
              })
            ),
            React.createElement(
              'a',
              { href: '#googleplay', className: 'app-store-link' },
              React.createElement('img', {
                src: 'https://upload.wikimedia.org/wikipedia/commons/5/53/Google_Play_Store_badge_EN.svg',
                alt: 'Google Play',
                className: 'store-icon'
              })
            )
          )
        )
      ),
      // Sağ kısım: Örnek “Popular” coin listesi
      React.createElement(
        'div',
        { className: 'right-content' },
        React.createElement(
          'div',
          { className: 'new-listing' },
          React.createElement(
            'h3',
            null,
            'Popular'
          ),
          React.createElement(
            'ul',
            { className: 'coin-list' },
            React.createElement(
              'li',
              null,
              React.createElement('span', { className: 'coin-name' }, 'BTC Bitcoin'),
              React.createElement('span', { className: 'coin-price positive' }, '$19,583.81')
            ),
            React.createElement(
              'li',
              null,
              React.createElement('span', { className: 'coin-name' }, 'ETH Ethereum'),
              React.createElement('span', { className: 'coin-price positive' }, '$1,598.71')
            ),
            React.createElement(
              'li',
              null,
              React.createElement('span', { className: 'coin-name' }, 'BNB BNB'),
              React.createElement('span', { className: 'coin-price positive' }, '$298.99')
            ),
            React.createElement(
              'li',
              null,
              React.createElement('span', { className: 'coin-name' }, 'XRP XRP'),
              React.createElement('span', { className: 'coin-price positive' }, '$0.52')
            ),
            React.createElement(
              'li',
              null,
              React.createElement('span', { className: 'coin-name' }, 'SOL Solana'),
              React.createElement('span', { className: 'coin-price positive' }, '$12.63')
            )
          )
        ),
        React.createElement(
          'div',
          { className: 'news-section' },
          React.createElement(
            'h3',
            null,
            'News'
          ),
          React.createElement(
            'ul',
            { className: 'news-list' },
            React.createElement(
              'li',
              null,
              'Tokeny Proposes Regulatory Suggestions for Digital Securities to SEC'
            ),
            React.createElement(
              'li',
              null,
              'U.S. Senate Banking Committee to Review Stablecoin Regulation Proposal'
            ),
            React.createElement(
              'li',
              null,
              'JPMorgan Adjusts Ratings for Bitcoin Miners Under Pressure'
            ),
            React.createElement(
              'li',
              null,
              'Cardo to Integrate Hashnode Tokenized Fund under Bermuda Regulation'
            )
          )
        )
      )
    )
  );
};

export default LandingPage;
